const fs = require('fs');
const concat = require('concat-stream');

module.exports = class PNGImage {
    static create(...args) {
        return new this(...args);
    }

    constructor(png) {
        this._png = png;
    }

    getPixel(x, y) {
        const idx = this._getIdx(x, y);
        return {
            R: this._png.data[idx],
            G: this._png.data[idx + 1],
            B: this._png.data[idx + 2]
